from pybricks.hubs import PrimeHub
from pybricks.parameters import Axis, Button, Color, Direction, Port, Stop
from pybricks.pupdevices import ColorSensor, Motor, UltrasonicSensor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
Brain = PrimeHub(top_side=Axis.Z, front_side=Axis.X)
color_sensor = ColorSensor(Port.F)
distance_sensor = UltrasonicSensor(Port.A)
Left_Motor = Motor(Port.E, Direction.COUNTERCLOCKWISE)
Right_Motor = Motor(Port.B, Direction.CLOCKWISE)
DriveTrain = DriveBase(Left_Motor, Right_Motor, 62, 93.5)
Right_Attachment = Motor(Port.D, Direction.CLOCKWISE)
Left_Attachment = Motor(Port.C, Direction.CLOCKWISE)

# Initialize variables.
Straight_Speed = 950
Straight_Acceleration = 925
Turn_Speed = 400
Turn_Acceleration = 700
Program_List = ['1', '2', '3', '4', '5', '6', '7', '8']
In_Leg = 0
Current_Program = 1

async def Code_Selecting():
    global Current_Program, In_Leg
    await wait(0)
    # This function allows you to choose a code to run on the robot without
    # the color sensor.
    if Button.RIGHT in Brain.buttons.pressed():
        Current_Program = Current_Program + 1
        await wait(350)
    elif Button.LEFT in Brain.buttons.pressed():
        Current_Program = Current_Program - 1
        await wait(350)
    elif Button.CENTER in Brain.buttons.pressed():
        if Current_Program == 1:
            Brain.light.on(Color.GREEN)
            await wait(300)
            await Collector()
        elif Current_Program == 2:
            Brain.light.on(Color.GREEN)
            await wait(300)
            await Raise_the_Mast()
        elif Current_Program == 3:
            Brain.light.on(Color.GREEN)
            await wait(300)
            await Coral_Tree()
        elif Current_Program == 4:
            Brain.light.on(Color.GREEN)
            await wait(300)
            await Boad_Dump()
        elif Current_Program == 5:
            Brain.light.on(Color.GREEN)
            await wait(200)
            await Go_Across()
        elif Current_Program == 6:
            Brain.light.on(Color.GREEN)
            await wait(100)
            await Feed_the_Whale()
        elif Current_Program == 7:
            Brain.light.on(Color.GREEN)
            await wait(100)
            await Squid_and_Submersible()
        else:
            Brain.light.on(Color.GREEN)
            await wait(100)
            await Battery()
    else:
        await wait(100)
    In_Leg = 0

async def subtask():
    await Right_Attachment.run_angle(200, -50)
    await wait(125)
    await Right_Attachment.run_angle(500, 50)

async def Collector():
    global Current_Program
    await wait(0)
    await Start_Code()
    # Collects krill and coral
    DriveTrain.settings(straight_speed=Straight_Speed - 390)
    DriveTrain.settings(straight_acceleration=Straight_Acceleration - 520)
    DriveTrain.settings(turn_rate=Turn_Speed - 100)
    await DriveTrain.straight(-670)
    # Collects plankton sample
    await wait(80)
    await DriveTrain.turn(50)
    await DriveTrain.straight(-95)
    await Right_Attachment.run_angle(300, 95)
    # Drives toward the Angler Fish, completing it
    # turning to collect the seabed sample.
    await DriveTrain.straight(110)
    DriveTrain.settings(turn_acceleration=Turn_Acceleration + 600)
    DriveTrain.settings(turn_rate=Turn_Speed + 100)
    await DriveTrain.turn(-125)
    DriveTrain.settings(turn_acceleration=Turn_Acceleration - 100)
    DriveTrain.settings(turn_rate=Turn_Speed - 100)
    await multitask(
        DriveTrain.straight(-250),
        subtask(),
    )
    await DriveTrain.turn(-13)
    # hits the anglerfish
    await multitask(
        DriveTrain.straight(-440),
    )
    await DriveTrain.turn(33)
    await DriveTrain.straight(-140)
    await Left_Attachment.run_angle(350, -125)
    await DriveTrain.straight(-100)
    await wait(250)
    await Left_Attachment.run_angle(300, 115)
    await wait(250)
    Left_Attachment.hold()
    await multitask(
        DriveTrain.turn(-50),
    )
    # Collects the rest of the  krill and coral, goes home
    await DriveTrain.straight(-150)
    await DriveTrain.arc(375, angle=-45)
    await DriveTrain.straight(-550)
    # FINISH!!!
    Left_Attachment.stop()
    Current_Program = 2

async def Raise_the_Mast():
    global Current_Program
    await wait(0)
    await Start_Code()
    # Lines up with ship
    DriveTrain.settings(straight_acceleration=Straight_Acceleration - 500)
    await DriveTrain.straight(-410)
    await DriveTrain.turn(33, then=Stop.COAST)
    await DriveTrain.straight(-160)
    DriveTrain.settings(turn_rate=Turn_Speed - 250)
    await DriveTrain.turn(60, then=Stop.COAST)
    # Opens ship and grab chest
    DriveTrain.settings(straight_acceleration=Straight_Acceleration - 100)
    await DriveTrain.straight(-325)
    # Gets krill
    DriveTrain.settings(straight_acceleration=Straight_Acceleration - 500)
    await Left_Attachment.run_angle(175, 100)
    # Goes home
    await DriveTrain.straight(160)
    DriveTrain.settings(turn_rate=Turn_Speed + 100)
    DriveTrain.settings(straight_speed=Straight_Speed + 100)
    DriveTrain.settings(straight_acceleration=Straight_Acceleration + 100)
    await DriveTrain.turn(120)
    await DriveTrain.straight(-500, then=Stop.COAST)
    # FINISH!!!
    Current_Program = 3

