async def Color_Select():
    await wait(0)
    # These allow for certain codes to start when the color sensor sees
    # a set color. It also ensures that we do not touch the robot when starting
    # a code.
    if await color_sensor.color() == Color.BLUE:
        Brain.light.on(Color.GREEN)
        await wait(450)
        await Coral_Tree()
    elif await color_sensor.color() == Color.YELLOW:
        Brain.light.on(Color.GREEN)
        await wait(450)
        await Raise_the_Mast()
    elif await color_sensor.color() == Color.GREEN:
        Brain.light.on(Color.GREEN)
        await wait(450)
        await Feed_the_Whale()
    elif await color_sensor.color() == Color.WHITE:
        Brain.light.on(Color.GREEN)
        await wait(450)
    else:
        pass

async def Feed_the_Whale():
    global Current_Program
    await wait(0)
    await Start_Code()

    DriveTrain.settings(straight_acceleration=Straight_Acceleration - 500)
    await DriveTrain.straight(-750, then=Stop.COAST)
    await DriveTrain.turn(42)
    DriveTrain.settings(straight_speed=250)
    await wait(100)
    # drives into whale  and waits while Abyss drops the krill
    await DriveTrain.straight(-130)
    await wait(1000)
    # drives from whale to sonar
    DriveTrain.settings(straight_speed=Straight_Speed)
    await DriveTrain.straight(125)
    await DriveTrain.turn(53)
    await DriveTrain.straight(220)
    # rotates sonar
    await Right_Attachment.run_angle(400, 200)
    await DriveTrain.straight(100)
    DriveTrain.settings(straight_acceleration=Straight_Acceleration + 50)
    await Right_Attachment.run_angle(500, -70)
    await DriveTrain.curve(-175, -60)
    # returns to home
    DriveTrain.settings(straight_speed=Straight_Speed)
    await DriveTrain.straight(-650)
    Current_Program = 7

