async def Coral_Tree():
    await wait(0)
    await Start_Code()
    DriveTrain.settings(straight_acceleration=Straight_Acceleration - 500)
    # drives to coral nursery and pushes up coral buds
    await DriveTrain.straight(-150)
    await DriveTrain.turn(50)
    await DriveTrain.straight(-250)
    await DriveTrain.turn(-47)
    await DriveTrain.straight(-375)
    await DriveTrain.turn(-45)
    await DriveTrain.straight(-165)
    await DriveTrain.turn(-45)
    DriveTrain.settings(straight_acceleration=Straight_Acceleration + 100)
    await multitask(
        subtask3(),
        subtask4(),
        subtask5(),
        race=True,
    )
    await wait(500)
    # Back up
    await DriveTrain.straight(150)
    DriveTrain.settings(turn_rate=Turn_Speed / 3)
    await multitask(
        subtask6(),
        DriveTrain.turn(-90),
        race=True,
    )
    DriveTrain.settings(turn_rate=Turn_Speed + 100)
    await multitask(
        DriveTrain.arc(-800, distance=-800),
        Left_Attachment.run_angle(300, -100),
    )

